INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760258640041', 'Juicerie', 'UICERIE jus sont pressés à froid Chez Juicerie, nos quotidiennement et de manière artisanale à Paris, à de fruits et légumes frais, bio, crus et naturels, pour offrir à votre organisme une pause vertueuse et regénérante sans jamais décevoir votre palais. Issus de cultures biologiques, nos fruits et légumes sont minutieusement sélectionnés et pressés à froid à l\'aide d\'une presse hydraulique. Le jus est extrait de manière Inte sans jamais le chauffer ni l\'exposer à l\'air, lui permettant ainsi de conserver tous les nutriments minérau enzymes et vitamines bons pour l\'organisme. Efrafrais, sans conservateur ni additif, ce jus se au réfrigérateur. Le dépôt est naturel, agiter ivantde déguster ! 75002 Paris hivjuicerie.fr @ f juicerie.paris Onsommerjusqu\'au : 3 760258 640041', 'https://static.openfoodfacts.org/images/products/376/025/864/0041/front_fr.4.400.jpg', '1', '1', '1', '1', '', '1', '1', '0.393700787401575', '', '1');

