INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760264900023', 'Arthur', '15 Capsules TYPE Nespresso. Arthur est un Terra-Trotteur fougueux et intrépide, qui trouve toutes les bonnes raisons de survoler les continents à la recherche des cafés les plus exotiques. A la personnalité altruiste et à la curiosité aiguisée, il est l\'ami des meilleurs agriculteurs des plaines brésiliennes. Son assemblage composé d\'Arabica du Brésil et du Mexique, accompagné d\'un Robusta de Tanzanie, crée un café riche, très équilibré et avec du corps. C\'est un délice. Nos Terra-testeurs lui ont attribué la note de 4.8 sur 5. INGREDIENTS CAFES GRANDS CRUS BIO ARABICA ET ROBUSTA DU BRESIL, DU MEXIQUE ET DE TANZANIE Poids net: 84ge WT 2.96 oz 0GM FREE 100 % BIODEGRADABLE', 'https://static.openfoodfacts.org/images/products/376/026/490/0023/front_fr.5.400.jpg', '', '', '', '', '', '', '', '', '', '1');

