VALUES ('3760264900030', 'Epicerie / Boissons Et Vins / Café Bio Et équitable', 'Ce capé esb remarquable par sa saveur Pruibée qui nous interpelle dès son entrée en bouche. Comme nous, vous le recommanderez à vos meilleurs amis. Nos Terra-besbeurs lui ont abbribué la note de 4.8 sur 5 (PIJ 100 DU ptPOU', 'https://static.openfoodfacts.org/images/products/376/026/490/0030/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '0', '0', '0', '', '1');

