VALUES ('3760264900627', 'Arthur', '2017 NOTRE ENGAGEMENT ENVIRONNEMENTAL : Toute léquipe de Terramoka est persuadée que nous pouvons bous jouer un rôle décisip dans la préservation de notre planète. Retrouvez sur notre site internet nos engagements et certifications ainsi que notre gamme de capsules 100% BIODEGRADABLE, 100% COMPOSTABLE et 0 % Aluminium. NOTRE ENGAGEMENT FRAICHEUR: Nous pouvons affirmer que lorsque l\'on a savouré un café Fraichement torréfié, il n\'est plus possible de revenir en arrière. Nos cafés sont certifiés grands crus et torréfiés selon nos méthodes artisanales lentes et refroidies à l\'air NOTRE ENGAGEMENT ÉTHIQUE ramoka a choisi d\'acheter son café BIO plus cher, permettre aux pays producteurs de connaître un développement durable, tant économique que social et environnemental. vrez nos hommes de l\'art sur Terramoka.com gène alimentaire tel que (oeuf, Pruit rouge, soja, arachide). 1 rue de l\' Égalité 92220 BAGNEUX contact@terramoka.com Tél. 01 42 53 84 33 Ingrédient : Cafés Grands Crus 80% Arabica et 20% Robusta Bio du Brésil, du Mexique et de Tanzanie non UE Poids net : 200ge', '', '', '', '', '', '', '', '', '', '', '1');

